                            q.append(n)
                            visited.add(n)
                steps += 1
            return -1

        def get_start(forest):
            for i in range(len(forest)):
                for j in range(len(forest[0])):
                    if forest[i][j] > 1:
                        return (i, j)
            return None

        start = get_start(forest)
        if not start:
            return -1
        steps = bfs(start, (len(forest)-1, len(forest[0])-1))
        if steps == -1:
            return -1
