    def find_pivot(self, nums):
        """
        Find the pivot in the array
        """
        left, right = 0, len(nums) - 1

        while left <= right:
            mid = (left + right) // 2

            if nums[mid] > nums[mid + 1]:
                return mid + 1

            if nums[mid] < nums[mid - 1]:
                return mid

            if nums[mid] > nums[left]:
                left = mid + 1
            else:
                right = mid - 1

    def binary_search(self, nums, target, left, right):
        """
        Binary search in the array
        """
        while left <= right:
            mid = (left + right) // 2

            if nums[mid] == target:
                return mid

            if nums[mid] < target:
                left = mid + 1
            else:
                right = mid - 1

